import React from "react";
import styled from "styled-components";
import { PieChart, Pie, Cell, ResponsiveContainer, BarChart, Bar, XAxis, YAxis, Tooltip } from "recharts";
import { motion } from "framer-motion";

const COLORS = ["#6366f1", "#22c55e", "#f59e42", "#ef4444", "#a21caf"];

const Card = styled(motion.div)`
  background: #f5f7ff;
  border-radius: 1.2rem;
  box-shadow: 0 2px 12px rgba(99,102,241,0.04);
  padding: 1.5rem 1.2rem 1.2rem 1.2rem;
  margin-bottom: 1.2rem;
`;

const SectionTitle = styled.h3`
  color: #3730a3;
  font-size: 1.1rem;
  font-weight: 700;
  margin: 0 0 0.7rem 0;
`;

const ProgressBar = styled.div`
  background: #e0e7ff;
  border-radius: 1rem;
  height: 18px;
  width: 100%;
  margin-bottom: 0.7rem;
  overflow: hidden;
`;
const Progress = styled.div`
  background: linear-gradient(90deg, #6366f1 0%, #22c55e 100%);
  height: 100%;
  border-radius: 1rem;
  transition: width 0.7s cubic-bezier(.4,0,.2,1);
`;

const Tag = styled.span`
  display: inline-block;
  background: #6366f1;
  color: #fff;
  border-radius: 0.7em;
  padding: 0.2em 0.8em;
  font-size: 0.95em;
  margin: 0.2em 0.3em 0.2em 0;
`;

const GraphicalAnalysis = ({ feedback }) => {
  if (!feedback) return null;
  // Score
  const score = Number(feedback.score) || 0;
  // ATS Compliance (simulate for now)
  const ats = feedback.ats_compliance ? Number(feedback.ats_compliance) : Math.round(70 + Math.random() * 20);
  // Skill Match (simulate for now)
  let skillMatch = 0;
  if (feedback.skill_match) {
    if (typeof feedback.skill_match === 'string') {
      skillMatch = feedback.skill_match.length > 0 ? 80 : 50;
    } else if (typeof feedback.skill_match === 'object') {
      skillMatch = feedback.skill_match["Technical Skills"] ? 90 : 60;
    }
  }
  // Experience Quality (simulate)
  const expQuality = feedback.experience_quality ? Number(feedback.experience_quality) : Math.round(60 + Math.random() * 30);
  // Red Flags (simulate)
  const redFlags = feedback.red_flags || [];
  // Targeted Roles (simulate)
  const roles = feedback.targeted_roles || ["Software Engineer", "Data Analyst", "Product Manager"];

  return (
    <>
      <Card initial={{ opacity: 0, y: 20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.7 }}>
        <SectionTitle>Resume Score</SectionTitle>
        <ProgressBar>
          <Progress style={{ width: `${score}%` }} />
        </ProgressBar>
        <div style={{ fontWeight: 700, color: '#3730a3', fontSize: '1.3em' }}>{score}/100</div>
      </Card>
      <Card initial={{ opacity: 0, y: 20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.8 }}>
        <SectionTitle>ATS Compliance</SectionTitle>
        <ProgressBar>
          <Progress style={{ width: `${ats}%`, background: 'linear-gradient(90deg, #f59e42 0%, #22c55e 100%)' }} />
        </ProgressBar>
        <div style={{ fontWeight: 700, color: '#f59e42', fontSize: '1.1em' }}>{ats}%</div>
      </Card>
      <Card initial={{ opacity: 0, y: 20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 0.9 }}>
        <SectionTitle>Skill Match</SectionTitle>
        <ProgressBar>
          <Progress style={{ width: `${skillMatch}%`, background: 'linear-gradient(90deg, #6366f1 0%, #a21caf 100%)' }} />
        </ProgressBar>
        <div style={{ fontWeight: 700, color: '#6366f1', fontSize: '1.1em' }}>{skillMatch}%</div>
        {feedback.skill_match && typeof feedback.skill_match === 'object' && (
          <div style={{ marginTop: 8 }}>
            {Object.entries(feedback.skill_match).map(([k, v]) => (
              <Tag key={k}>{k}: {v}</Tag>
            ))}
          </div>
        )}
      </Card>
      <Card initial={{ opacity: 0, y: 20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 1.0 }}>
        <SectionTitle>Targeted Roles</SectionTitle>
        <div style={{ marginTop: 8 }}>
          {roles.map(role => <Tag key={role}>{role}</Tag>)}
        </div>
      </Card>
      <Card initial={{ opacity: 0, y: 20 }} animate={{ opacity: 1, y: 0 }} transition={{ duration: 1.1 }}>
        <SectionTitle>Red Flags</SectionTitle>
        {redFlags.length === 0 ? <div style={{ color: '#22c55e' }}>None detected</div> : (
          <ul style={{ color: '#ef4444', margin: 0, paddingLeft: 18 }}>
            {redFlags.map((flag, idx) => <li key={idx}>{flag}</li>)}
          </ul>
        )}
      </Card>
    </>
  );
};

export default GraphicalAnalysis;
